(7, 60, 'About', 'about', '<h2 class="sap_h2_heading">THE DESIGN PRACTICE</h2>\r\n<p>Having set up his first practice while still at university, Michael Morris has been a director of a number of iconic practices in Melbourne including Morris and Pirrotta, Morris Architects and Morris Partnership.</p>\r\n<p>The formation of Michael Morris Architects continues this tradition.</p>\r\n<p>Always at the cutting edge of the design, Michael’s buildings are the ongoing subject of considerable acclaim. Clients include many well known personalities in the banking and business industries, government agencies, private individuals and community groups.</p>\r\n<p>The practice of Michael Morris Architects is purposely kept small. This enables Michael to focus on each individual building and be intimately involved from the initial design concept though to administration of the construction stage.</p>\r\n<p>His dedicated design team shares Michael’s commitment and passion in the achievement of high quality design outcomes.</p>\r\n<p> </p>\r\n<p> </p>', '', 1, 2, '2015-04-03 09:45:45', 989, '', '2016-06-09 01:50:31', 989, 0, '0000-00-00 00:00:00', '2015-04-03 09:45:45', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"_:default","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 17, 4, '', '', 1, 138, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(8, 61, 'Principals', 'principals', '<p> </p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td class="sapient_transparent_background" valign="top" width="30%"><span style="text-decoration: underline;">Michael Morris</span><br /> Director\r\n<p>B. Arch RAIA</p>\r\n<p>Dynamic, inventive and passionate about architecture, Michael Morris has a reputation for high quality design and a unique approach to each project. Michael’s buildings include many individual residences in city and country locations, retail showrooms, commercial offices, restaurants and cafes, tourist and leisure centres and many other specialist buildings. Michael is familiar with complex design briefs and has the experience which comes from meeting the needs of a diverse range of clients. He is closely involved in all stages of projects from concept design through to project administration.  </p>\r\n</td>\r\n<td width="5%"> </td>\r\n<td class="sapient_transparent_background" valign="top" width="30%"><span style="text-decoration: underline;">Christine Berry</span><br /> Associate\r\n<p>B.TRP</p>\r\n<p>With substantial experience in the planning, marketing and design industries, Christine brings a depth of understanding in the delivery of projects. She is actively involved with the design team in project concept design, town planning approvals and project administration. Christine’s input contributes to the practice’s high level of performance in the development approval process. Her familiarity with the design administration process and well-honed communication skills makes a strong contribution in the delivery of successful project outcomes.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', '', 1, 2, '2015-04-03 09:46:15', 989, '', '2016-06-08 22:13:40', 989, 0, '0000-00-00 00:00:00', '2015-04-03 09:46:15', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"michaelmorrisarchitectstemplate:nobackground","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 26, 3, '', '', 1, 94, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(9, 62, 'Contact', 'contact', '<h2 class="sap_h2_heading">CONTACT US</h2>\r\n<table width="100%">\r\n<tbody>\r\n<tr>\r\n<td valign="top" width="50%">\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td colspan="2"><b>East Melbourne</b></td>\r\n</tr>\r\n<tr>\r\n<td><img src="images/icons/home_white.png" alt="" height="30px" /></td>\r\n<td>Level 3, 372 Albert Road East Melbourne, 3002 <br /> Victoria, Australia</td>\r\n</tr>\r\n<tr>\r\n<td><img src="images/icons/phone16_white.png" alt="" height="30px" /></td>\r\n<td>+61 3 9465 253a4</td>\r\n</tr>\r\n<tr>\r\n<td colspan="2"><b>Mornington Peninsula</b></td>\r\n</tr>\r\n<tr>\r\n<td><img src="images/icons/home_white.png" alt="" height="30px" /></td>\r\n<td>22-24 Kent Road Rye, 3941<br /> Victoria, Australia</td>\r\n</tr>\r\n<tr>\r\n<td><img src="images/icons/phone16_white.png" alt="" height="30px" /></td>\r\n<td>+61 3 5985 9138</td>\r\n</tr>\r\n<tr>\r\n<td colspan="2"><b>Email</b> <br />{loadposition contact_form}</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n<td valign="top" width="50%">{phocamaps view=map|id=1}</td>\r\n</tr>\r\n</tbody>\r\n</table>', '', 1, 2, '2015-04-03 09:47:12', 989, '', '2016-06-08 23:44:42', 989, 0, '0000-00-00 00:00:00', '2015-04-03 09:47:12', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore