(26, 111, 'Tree House', 'tree-house-description', '<p><span style="font-size: 15px; mso-bidi-font-size: 11.0pt;">Perched in the Otway Ranges, the Lorne Tree House hides seductively amongst the eucalypts. The exterior of the house is clad in stained timber, copper, corten steel and painted cement sheet. These materials weather naturally to a recessive palette blending with the surrounding environment.The use of perforated metal screens at ground level enables through air flow to be maintained around the house. </span></p>\r\n<p><span style="font-size: 15px; mso-bidi-font-size: 11.0pt;">In the summer months movement of cool air up through the levels of the house minimizes the need for air conditioning. Interiors of the house are deliberately kept simple and in natural tonings. Timber floors blend seamlessly into the decks. Timber walkways at the entry bridge the steepness of the site thus enabling the natural gradients to remain unimpeded</span>.</p>\r\n<p> </p>', '', 1, 12, '2015-05-02 19:53:39', 989, '', '2016-06-09 22:10:03', 989, 989, '2016-06-09 22:10:03', '2015-05-02 19:53:39', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 9, 15, '', '', 1, 0, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(27, 113, 'Golf Course House', 'golf-course-house', '<div style="font-size: 15px;">\r\n<p>The green grassy fairways and lush landscaping of the 13th Beach Golf Course surround this residence. At the front entry, a central axis opens out to a stand of cypresses fringing the 1st tee. There are the occasional long views of golfers. The house embraces its natural surroundings and the beauty of the environment. Small private courtyards are also located within the house that enables the outdoors to be enjoyed in all seasons.</p>\r\n<p>The materials palette reflects the casual holiday style - spotted gum cladding predominating with individual modules attached in folded zincalume and painted cement sheet. These materials flow through to the interiors and are lustrously lit at night.</p>\r\n<p>The extensive central axis in polished concrete contrasts with the soft, lush, amber of the matt cork tiles throughout the kitchen, living and dining area. A glass roofed cylinder captures the morning light and folds around a circular table to provide an intimate breakfast space adjoined to the otherwise large volumes throughout.</p>\r\n</div>', '', 1, 12, '2015-05-02 20:42:33', 989, '', '2015-05-02 20:57:24', 989, 0, '0000-00-00 00:00:00', '2015-05-02 20:42:33', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 6, 14, '', '', 1, 5, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(28, 114, 'Hinterland House ', 'golf-course-house-2', '<div style="font-size: 15px;">\r\n<p>Arriving at Hinterland House is a startling experience. The sandy track winds through the sloping site and stops at a gravel clearing. A powerful rammed earth wall slices through the building and enables other elements to float. The site seems to flow through. There is no obvious entry. The house is deliberately illusive - it challenges expectations.</p>\r\n<p>The building enables views of the site to be enjoyed and confronted - the seductive dam, modest scrub, bushfire scarred eucalypts and abundant wildlife. The design is a fragmented building with living, working and sleeping zones separated by glazed slots, links and open spaces.</p>\r\n<p>Once inside, the excitement of the building and the site is revealed. Personal privacy is created without the use of barriers. Movement between zones provides a continual disconnection reinforced by changes in materials. The house requires a journey with minimal definition between the interior and exterior.</p>\r\n<p>This house is provocative in its rejection of any easy gratification of the aesthetic – it beckons the occupants to think, observe and encounter the uniqueness of the Australian bush.</p>\r\n</div>', '', 1, 12, '2015-05-02 20:42:33', 989, '', '2015-05-02 20:58:28', 989, 0, '0000-00-00 00:00:00', '2015-05-02 20:42:33', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 2, 13, '', '', 1, 0, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(29, 115, 'Sorrento Retreat', 'sorrento-retreat', '<div style="font-size: 15px;">\r\n<p>Constructed as a later addition to the Sorrento Beach House, the retreat adds a further dimension to this iconic beach house. The structure floats above the ground floor entertainment area in the form of a rotated cube. The staircase is a simply expressed form encased in white glass and blades of aluminium.</p>\r\n</div>', '', 1, 12, '2015-05-02 20:42:33', 989, '', '2015-05-02 21:12:02', 989, 0, '0000-00-00 00:00:00', '2015-05-02 20:42:33', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 5, 12, '', '', 1, 1, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', '');
