(30, 116, 'Merton House', 'merton-house', '<div style="font-size: 15px;">\r\n<p>Located in the foothills of the Great Dividing Range, this remote and steeply sloping site provides spectacular views of the Australian countryside. The building sits in a rocky outcrop and relies on the juxtaposition and linking of three simple box elements to express the building form. A large stone fireplace anchors the central core where the living room, kitchen and dining areas dramatically cantilever over the natural slope of the site. A series of decks and courtyards provide respite from prevailing winds and extremes of temperatures.</p>\r\n<p>The house provides an enriching, uniquely rural experience where the natural beauty of the site with its shaly outcrops, wind battered trees, lush young eucalypts and climatic extremes can be celebrated and enjoyed. The use of strong shapes and the imaginative blending and contrasting of relatively low cost, conventional materials are melded together to provide an uplifting experience. The house is respectful of the landscape yet has its own force and presence in providing the occupants with great sensory and visual cinema as the days and seasons unfold around it.</p>\r\n</div>', '', 1, 12, '2015-05-02 20:42:33', 989, '', '2015-05-02 21:13:02', 989, 0, '0000-00-00 00:00:00', '2015-05-02 20:42:33', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 2, 11, '', '', 1, 0, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(31, 117, 'Richmond House', 'richmond-house', '<div style="font-size: 15px;">\r\n<p>Responding boldly to the challenges of a tight inner city site, Richmond House provides a sanctuary amidst the traffic and intensity of the immediate surroundings. The interior is private, quiet and visually exciting. The exterior is assertive in its presence - but not dominating - and contributes to the vitality and interest of the street.</p>\r\n<p>The front façade is notched to provide a protected entry and enable views of the Victorian cottage adjacent. Large screens prevent invasive views and rooms revolve around protective courtyards and decks. A vertical garden is the main feature of the central internal courtyard.</p>\r\n<p>An adjacent peppercorn tree forms a protective veil. A stacked stone wall along the entry path conceals rain water tanks for the gardens and also holds grasses and orchids along the entry.</p>\r\n</div>', '', 1, 12, '2015-05-02 20:42:33', 989, '', '2016-06-09 22:08:54', 989, 0, '0000-00-00 00:00:00', '2015-05-02 20:42:33', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 5, 10, '', '', 1, 0, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(32, 118, 'Jonty House', 'jonty-house', '<div style="font-size: 15px;">\r\n<p>Located in the Melbourne inner city, this rear addition to a simple cottage breaks out exuberantly from the confines of the historic structure.</p>\r\n<p>Unseen from the heritage street frontage, the upper floor floats seamlessly and opens out to a concertina deck with panoramic city views. Privacy of neighbours is ensured by the use of screens formed from aluminium box sections. Enfolding the upper floor and, together with panels of white glass, these sections form an ephemeral band around the structure.</p>\r\n<p>The aesthetic potential of metal layering is celebrated by creating varying widths, perforation and sizing. The resultant softness of interior illumination and blending of the structure with the sky provides a heightened sense of lightness and exhilaration. A staircase clad in Spectra Alucobond gleams and is a theatrical negative joint marking the transition from old to new.</p>\r\n<p>A palette of contrasts is carefully crafted with stainless steel, timber and pale natural stone intersecting with dark grey Alpaca carpet, black terrazzo, concrete, bluestone and deep red corten steel. The pre-existing dark interior of the cottage has been retained for bedrooms – the journey through the building is towards the light of the new additions.</p>\r\n</div>', '', 1, 12, '2015-05-02 20:42:33', 989, '', '2015-05-02 21:23:29', 989, 0, '0000-00-00 00:00:00', '2015-05-02 20:42:33', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 2, 9, '', '', 1, 0, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(33, 119, 'Richmond Factory', 'richmond-factory', '<div style="font-size: 15px;">\r\n<p>The retention of the original concrete slab and the steel beam roof structure of this 1960’s factory provides a spacious and enlivening framework for its residential use.</p>\r\n<p>Pock marked rendered walls have been simply painted and interior lighting has been cabled through the exposed metal tubing suspended below the ceiling line. The minimum of internal structure provides a continual reminder of the building’s origins and adds to the excitement of the internal space. An enclosed courtyard has been relandscaped and provides a private open space large enough for vegetables in containers and flourishing citrus trees. A narrow side finger of land - seen at the entry - has been transformed by lush landscaping.</p>\r\n</div>', '', -2, 12, '2015-05-02 20:42:33', 989, '', '2015-05-02 21:29:08', 989, 0, '0000-00-00 00:00:00', '2015-05-02 20:42:33', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 3, 8, '', '', 1, 0, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(34, 120, 'Richmond Warehouse', 'richmond-warehouse', '<p><span style="line-height: 115%; font-family: ''Calibri'',sans-serif; font-size: 10pt; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: ''Times New Roman''; mso-bidi-theme-font: minor-bidi; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;"><span style="color: #000000;">Nestled inside a multi-story turn of the century warehousing complex, this refurbished building has soaring interior spaces and robust red brick walls retained from the original structure.</span><span style="mso-spacerun: yes;"><span style="color: #000000;">  </span></span></span></p>\r\n', '\r\n<p><span style="line-height: 115%; font-family: ''Calibri'',sans-serif; font-size: 10pt; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: ''Times New Roman''; mso-bidi-theme-font: minor-bidi; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;"><span style="mso-spacerun: yes;"><span style="color: #000000;">{loadposition residential_richmond_warehouse}</span></span></span></p>', 1, 8, '2015-05-02 21:36:47', 989, '', '2016-06-08 22:14:31', 989, 0, '0000-00-00 00:00:00', '2015-05-02 21:36:47', '0000-00-00 00:00:00', '{"image_intro":"images\\/Projects\\/residential\\/richmond_warehouse\\/richmond_Warehouse_article_listing.jpg","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 4, 7, '', '', 1, 16, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(35, 121, 'Richmond Warehouse', 'richmond-warehouse', '<div style="font-size: 15px;">\r\n<p>Nestled inside a multi-story turn of the century warehousing complex, this refurbished building has soaring interior spaces and robust red brick walls retained from the original structure.</p>\r\n<p>The dramatic, sculptural internal staircase provides access to bedrooms and bathrooms tucked under the ceiling line.</p>\r\n</div>', '', 1, 12, '2015-05-02 21:37:59', 989, '', '2015-05-11 04:47:26', 989, 989, '2016-06-09 22:05:18', '2015-05-02 21:37:59', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 1, 7, '', '', 1, 0, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
