(38, 127, 'Fins', 'fins', '<p>Corten steel slithers, perforated metal and mint alucobond were layered to provide a vertical sculpture seven meters high in a slender internal courtyard in Melbourne inner city.</p>\r\n', '\r\n<p>{loadposition design_fins}</p>', 1, 10, '2015-05-06 21:47:12', 989, '', '2015-05-12 00:50:26', 989, 0, '0000-00-00 00:00:00', '2015-05-06 21:47:12', '0000-00-00 00:00:00', '{"image_intro":"images\\/Projects\\/Design_elements\\/Fins\\/article_select.jpg","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 2, 2, '', '', 1, 5, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(39, 129, 'Monsoon', 'monsoon', '<div style="font-size: 15px;">\r\n<p>A range of tapware for Sussex Taps was designed in early 2003. Manufactured in Australia to a high standard including marine grade stainless steel, the range is ongoing with the Monsoon Shower and Mixer being a perennial favorite.</p>\r\n<p>As part of the overall design process marketing material was created to promote the monsoon products in the leisure and resort market.  </p>\r\n</div>', '', 1, 12, '2015-05-06 21:58:31', 989, '', '2015-08-25 04:14:54', 989, 0, '0000-00-00 00:00:00', '2015-05-06 21:58:31', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 2, 6, '', '', 1, 0, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(40, 130, 'Sorrento House', 'sorrento-house', '<p>The juxtaposition of strong geometric forms - constructed in local stone, glass, rheinzink and spotted gum - characterizes the design of this house.</p>\r\n', '\r\n<p>{loadposition residential_sorrento_house}</p>', 1, 8, '2015-05-11 04:41:59', 989, '', '2015-05-11 04:48:10', 989, 0, '0000-00-00 00:00:00', '2015-05-11 04:41:59', '0000-00-00 00:00:00', '{"image_intro":"images\\/Projects\\/residential\\/sorento_house\\/Sorrecto_retreat_article_listing.jpg","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 1, 8, '', '', 1, 18, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(41, 132, 'Sorrento house', 'sorrento-house', '<div style="font-size: 15px;">\r\n<p>The juxtaposition of strong geometric forms - constructed in local stone, glass, rheinzink and spotted gum - characterizes the design of this house. Ground floor entertainment areas open out on all sides engaging with the extensive recreational opportunities on the site – playing tennis, swimming, sunbathing, cooking pizzas, picking olives or gathering around the fire pit or BBQ.</p>\r\n<p>The building entry with the reflective pool, hovering rheinzinc cube and illuminated undercroft has been carefully crafted to create a hint of the fun and relaxation that being on holiday can provide. Interiors are casually grounded with the use of local stone for many walls, seamless indoor outdoor openings and rugged polished timber floors</p>\r\n</div>', '', 1, 12, '2015-05-11 04:46:20', 989, '', '2015-08-25 04:08:31', 989, 0, '0000-00-00 00:00:00', '2015-05-11 04:46:20', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 2, 8, '', '', 1, 1, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(42, 133, 'Frueauf Village', 'frueauf-village', '<div style="font-size: 15px;">\r\n<p>This multi-purpose ski village is located in the High Plains of South East Victoria at Falls Creek. The central core provides for a cinema and restaurant and is surrounded by separate lodges. The extreme climate has required the careful selection of materials which are natural stone, copper and timber cladding and galvanized steelwork. The vibrant combination of materials, together with the fragmented massing of the lodges, has created an exciting, iconic and popular destination in the resort.</p>\r\n</div>', '', 1, 12, '2015-05-11 05:08:45', 989, '', '2015-08-25 04:10:55', 989, 0, '0000-00-00 00:00:00', '2015-05-11 05:08:45', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 3, 5, '', '', 1, 0, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(43, 134, 'Pinecliff Horse Complex', 'pinecliff-horse-complex', '<div style="font-size: 15px;">\r\n<p>Located on the Mornington Peninsula, Pinecliff provides state of the art facilities in horse training, and environmentally sustainable management and landscape design.</p>\r\n<p>The original site of 50 hectares had been cleared for grazing and the site has now been transformed by the creation of a system of linked wetlands. These progressively filter waste water and enable its reuse throughout the site. A new 7.6 megalitre dam provides the final stage of this system. Water birds now flock to the site.</p>\r\n<p>A large scale innovative worm farm - 25 metres by 10 metres by average 2 metres depth - processes all horse manure, water, cardboard and grass/ landscape waste within the site. The worm farm provides the initial treatment of waste with worm castings being used for ongoing fertilization of the grassed horse yards.</p>\r\n</div>', '', 1, 12, '2015-05-11 05:15:22', 989, '', '2015-08-25 04:12:00', 989, 0, '0000-00-00 00:00:00', '2015-05-11 05:15:22', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 2, 4, '', '', 1, 0, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(44, 135, 'Reece Design', 'reece-design', '<div style="font-size: 15px;">\r\n<p>Located in inner city Melbourne, Reecedesign was a showroom created in 2001 for architects, interior designers and the design aware public.</p>\r\n<p>Built over two levels in a major renovation of the existing industrial structure, the showroom provided for the display of an extensive range of bathroom and kitchen products. Water connection to many fitments enabled the full impact of tapware to be experienced – a new innovation at the time.</p>\r\n<p>Products featured designs from a number of international companies not seen before in Australia and a new benchmark was created in the quality of presentation for such showrooms.</p>\r\n</div>', '', 1, 12, '2015-05-11 05:35:41', 989, '', '2015-08-25 04:12:22', 989, 0, '0000-00-00 00:00:00', '2015-05-11 05:35:41', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 2, 3, '', '', 1, 0, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(45, 136, 'Mandala Winery', 'mandala-winery', '<div style="font-size: 15px;">\r\n<p>Preserving the magnificent views to the surrounding Yarra Ranges and providing an intense rural experience for visitors, were key determinants in the design of the Mandala Winery.</p>\r\n<p>There is minimal definition between the indoors and outdoors. Large sections of openable glass provide for outdoor wine tasting and dining. Building materials feature corten steel, recycled rubber flooring and spotted gum timber. A Bocce court encourages outdoor recreation while the Green enables larger scale music and market events to be held and the occasional landing of hot air Balloons. All roof water is recycled for landscape uses.</p>\r\n<p>The Melba Highway has been screened by mounds and extensive native planting and car parking is largely concealed behind a screen of vines. The Master Plan also provides for future processing of grapes on site which will further enhance the wine making experience for visitors.</p>\r\n</div>', '', 1, 12, '2015-05-11 05:41:45', 989, '', '2015-08-25 04:11:33', 989, 0, '0000-00-00 00:00:00', '2015-05-11 05:41:45', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 2, 2, '', '', 1, 0, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(46, 137, 'Storm Water Grates', 'storm-water-grates', '<p>At Pinecliff Horse Training Complex these storm water grates were custom designed to prevent horses hooves from slipping.</p>\r\n', '\r\n<p>{loadposition design_stormwater}</p>', 1, 10, '2015-05-11 05:54:01', 989, '', '2015-05-12 00:50:26', 989, 0, '0000-00-00 00:00:00', '2015-05-11 05:54:01', '0000-00-00 00:00:00', '{"image_intro":"images\\/Projects\\/Design_elements\\/Stormwater\\/article_select.JPG","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 2, 4, '', '', 1, 8, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(47, 139, 'Stacking Stones', 'stacking-stones', '<p>These stone sculptures were created from granite offcuts collected from a stone mason</p>\r\n', '\r\n<p>{loadposition design_stacking_stones}</p>', 1, 10, '2015-05-11 05:58:48', 989, '', '2015-05-12 00:50:26', 989, 0, '0000-00-00 00:00:00', '2015-05-11 05:58:48', '0000-00-00 00:00:00', '{"image_intro":"images\\/Projects\\/Design_elements\\/StackingStones\\/article_select.jpg","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 2, 5, '', '', 1, 5, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(48, 141, 'Screen', 'screen', '<p>Composed of surplus building materials and bamboo stakes, the screen conceals private open space at the side of a humble beach shack.</p>\r\n', '\r\n<p>{loadposition design_screen}</p>', 1, 10, '2015-05-12 00:48:14', 989, '', '2015-05-12 22:11:26', 989, 0, '0000-00-00 00:00:00', '2015-05-12 00:48:14', '0000-00-00 00:00:00', '{"image_intro":"images\\/Projects\\/Design_elements\\/screen\\/Article Select.jpg","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 2, 7, '', '', 1, 6, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
