(57, 157, 'The Financial Review', 'the-financial-review', '', '\r\n<p>{loadposition media_financial_review}</p>', 1, 11, '2015-05-12 04:08:40', 989, '', '2015-05-12 04:08:40', 0, 0, '0000-00-00 00:00:00', '2015-05-12 04:08:40', '0000-00-00 00:00:00', '{"image_intro":"images\\/Media\\/The_Financial_Review\\/article select.jpg","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 1, 0, '', '', 1, 7, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(58, 163, 'Principals Mobile', 'principals-2', '<h2 class="sap_h2_heading">DESIGN PRINCIPALS</h2>\r\n<h4><span style="text-decoration: underline;">Christine Berry</span><br />Associate</h4>\r\n<p>B.TRP</p>\r\n<p>With substantial experience in the planning, marketing and design industries, Christine brings a depth of understanding in the delivery of projects. She is actively involved with the design team in project concept design, town planning approvals and project administration. Christine’s input contributes to the practice’s high level of performance in the development approval process. Her familiarity with the design administration process and well-honed communication skills makes a strong contribution in the delivery of successful project outcomes.</p>\r\n<h4><span style="text-decoration: underline;">Michael Morris</span><br /> Director</h4>\r\n<p>B. Arch RAIA</p>\r\n<p>Dynamic, inventive and passionate about architecture, Michael Morris has a reputation for high quality design and a unique approach to each project. Michael’s buildings include many individual residences in city and country locations, retail showrooms, commercial offices, restaurants and cafes, tourist and leisure centres and many other specialist buildings. Michael is familiar with complex design briefs and has the experience which comes from meeting the needs of a diverse range of clients. He is closely involved in all stages of projects from concept design through to project administration.  </p>', '', 1, 2, '2015-04-03 09:46:15', 989, '', '2016-06-09 02:20:53', 989, 0, '0000-00-00 00:00:00', '2015-04-03 09:46:15', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"michaelmorrisarchitectstemplate:mobile","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 12, 1, '', '', 1, 33, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', '');
