(59, 165, 'Vegetable Garden in the Bush', 'vegetable-garden-in-the-bush', '<p>Vegetable Garden in the Bush</p>\r\n', '\r\n<p>{loadposition design_vegiegarden}</p>', 1, 10, '2015-08-25 04:19:48', 989, '', '2015-08-25 04:32:22', 989, 0, '0000-00-00 00:00:00', '2015-08-25 04:19:48', '0000-00-00 00:00:00', '{"image_intro":"images\\/Projects\\/Design_elements\\/vegegarden\\/article_select.jpg","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 3, 0, '', '', 1, 10, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(60, 167, 'Vegetable Garden in the Bush', 'vegetable-garden-in-the-bush', '<div style="font-size: 15px;">\r\n<p>Marooning kangaroos, possums, rabbits and birds necessitated the construction of this enclosure of the vegetable garden in the Australian Bush.</p>\r\n<p>A fine tubular frame is covered in the wire mesh and a barrier is set into the earth. The soaring volume of the enclosure is sufficient for the growth of fruit trees and vines.</p>\r\n</div>', '', 1, 12, '2015-08-25 04:31:22', 989, '', '2015-08-25 04:34:15', 989, 0, '0000-00-00 00:00:00', '2015-08-25 04:31:22', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 3, 1, '', '', 1, 0, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(61, 168, 'About - Mobile', 'about-2', '<h2 class="sap_h2_heading">THE DESIGN PRACTICE</h2>\r\n<p>Having set up his first practice while still at university, Michael Morris has been a director of a number of iconic practices in Melbourne including Morris and Pirrotta, Morris Architects and Morris Partnership.</p>\r\n<p>The formation of Michael Morris Architects continues this tradition.</p>\r\n<p>Always at the cutting edge of the design, Michael’s buildings are the ongoing subject of considerable acclaim. Clients include many well known personalities in the banking and business industries, government agencies, private individuals and community groups.</p>\r\n<p>The practice of Michael Morris Architects is purposely kept small. This enables Michael to focus on each individual building and be intimately involved from the initial design concept though to administration of the construction stage.</p>\r\n<p>His dedicated design team shares Michael’s commitment and passion in the achievement of high quality design outcomes.</p>\r\n<p> </p>\r\n<p> </p>', '', 1, 2, '2015-04-03 09:45:45', 989, '', '2016-06-09 02:25:41', 989, 0, '0000-00-00 00:00:00', '2015-04-03 09:45:45', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"michaelmorrisarchitectstemplate:mobile","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 4, 0, '', '', 1, 4, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(62, 170, 'Hidden Warehouse', 'hidden-warehouse-2', '<p><span style="line-height: 115%; font-family: ''Calibri'',sans-serif; font-size: 10pt; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: ''Times New Roman''; mso-bidi-theme-font: minor-bidi; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;"><span style="color: #000000;">The retention of the original concrete slab and the steel beam roof structure of this 1960’s factory provides a spacious and enlivening framework for its residential use. <br /></span></span></p>\r\n', '\r\n<p> {loadposition residential_hidden_warehouse}</p>', 1, 8, '2015-04-09 02:43:58', 989, '', '2016-06-09 06:15:52', 989, 0, '0000-00-00 00:00:00', '2015-04-09 02:43:58', '0000-00-00 00:00:00', '{"image_intro":"images\\/Projects\\/residential\\/hidden_warehouse\\/HERO.jpg","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 6, 0, '', '', 1, 15, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(63, 171, 'Hidden Warehouse', 'hidden-warehouse-2', '<div style="font-size: 15px;"> </div>\r\n<div style="font-size: 15px;">The retention of the original concrete slab and the steel beam roof structure of this 1960’s factory provides a spacious and enlivening framework for its residential use.Pock marked rendered walls have been simply painted and interior lighting has been cabled through the exposed metal tubing suspended below the ceiling line.</div>\r\n<div style="font-size: 15px;"> </div>\r\n<div style="font-size: 15px;">The minimum of internal structure provides a continual reminder of the building’s origins and adds to the excitement of the internal space. An enclosed courtyard has been re landscaped and provides a private open space large enough for vegetables in containers and flourishing citrus trees.</div>\r\n<div style="font-size: 15px;"> </div>\r\n<div style="font-size: 15px;">A narrow side finger of land - seen at the entry - has been transformed by lush landscaping.</div>', '', 1, 12, '2015-05-11 05:41:45', 989, '', '2016-06-09 06:20:20', 989, 989, '2016-06-09 06:20:20', '2015-05-11 05:41:45', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 7, 0, '', '', 1, 0, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', '');

