(168, 29, 1, '', '2015-05-02 21:05:17', 989, 2881, 'b66829145d93e2a19275e52780fb1de2106a8d55', '{"id":29,"asset_id":115,"title":"Hinterland House  (2)","alias":"golf-course-house-3","introtext":"<div style=\\"font-size: 15px;\\">\\r\\n<p>Arriving at Hinterland House is a startling experience. The sandy track winds through the sloping site and stops at a gravel clearing. A powerful rammed earth wall slices through the building and enables other elements to float. The site seems to flow through. There is no obvious entry. The house is deliberately illusive - it challenges expectations.<\\/p>\\r\\n<p>The building enables views of the site to be enjoyed and confronted - the seductive dam, modest scrub, bushfire scarred eucalypts and abundant wildlife. The design is a fragmented building with living, working and sleeping zones separated by glazed slots, links and open spaces.<\\/p>\\r\\n<p>Once inside, the excitement of the building and the site is revealed. Personal privacy is created without the use of barriers. Movement between zones provides a continual disconnection reinforced by changes in materials. The house requires a journey with minimal definition between the interior and exterior.<\\/p>\\r\\n<p>This house is provocative in its rejection of any easy gratification of the aesthetic \\u2013 it beckons the occupants to think, observe and encounter the uniqueness of the Australian bush.<\\/p>\\r\\n<\\/div>","fulltext":"","state":0,"catid":"12","created":"2015-05-02 20:42:33","created_by":"989","created_by_alias":"","modified":"2015-05-02 21:05:17","modified_by":null,"checked_out":null,"checked_out_time":null,"publish_up":"2015-05-02 20:42:33","publish_down":"","images":"{\\"image_intro\\":\\"\\",\\"float_intro\\":\\"\\",\\"image_intro_alt\\":\\"\\",\\"image_intro_caption\\":\\"\\",\\"image_fulltext\\":\\"\\",\\"float_fulltext\\":\\"\\",\\"image_fulltext_alt\\":\\"\\",\\"image_fulltext_caption\\":\\"\\"}","urls":"{\\"urla\\":false,\\"urlatext\\":\\"\\",\\"targeta\\":\\"\\",\\"urlb\\":false,\\"urlbtext\\":\\"\\",\\"targetb\\":\\"\\",\\"urlc\\":false,\\"urlctext\\":\\"\\",\\"targetc\\":\\"\\"}","attribs":"{\\"show_title\\":\\"\\",\\"link_titles\\":\\"\\",\\"show_tags\\":\\"\\",\\"show_intro\\":\\"\\",\\"info_block_position\\":\\"\\",\\"show_category\\":\\"\\",\\"link_category\\":\\"\\",\\"show_parent_category\\":\\"\\",\\"link_parent_category\\":\\"\\",\\"show_author\\":\\"\\",\\"link_author\\":\\"\\",\\"show_create_date\\":\\"\\",\\"show_modify_date\\":\\"\\",\\"show_publish_date\\":\\"\\",\\"show_item_navigation\\":\\"\\",\\"show_icons\\":\\"\\",\\"show_print_icon\\":\\"\\",\\"show_email_icon\\":\\"\\",\\"show_vote\\":\\"\\",\\"show_hits\\":\\"\\",\\"show_noauth\\":\\"\\",\\"urls_position\\":\\"\\",\\"alternative_readmore\\":\\"\\",\\"article_layout\\":\\"\\",\\"show_publishing_options\\":\\"\\",\\"show_article_options\\":\\"\\",\\"show_urls_images_backend\\":\\"\\",\\"show_urls_images_frontend\\":\\"\\"}","version":1,"ordering":null,"metakey":"","metadesc":"","access":"1","hits":null,"metadata":"{\\"robots\\":\\"\\",\\"author\\":\\"\\",\\"rights\\":\\"\\",\\"xreference\\":\\"\\"}","featured":"0","language":"*","xreference":""}', 0),
(169, 29, 1, '', '2015-05-02 21:06:10', 989, 2500, 'a887e94ae1be6c9c4658100b8c35f25c37c86d4c', '{"id":29,"asset_id":"115","title":"Sorrento Beach House","alias":"sorrento-beach-house","introtext":"<div style=\\"font-size: 15px;\\">\\r\\n<p>The juxtaposition of strong geometric forms - constructed in local stone, glass, rheinzink and spotted gum - characterizes the design of this house. Ground floor entertainment areas open out on all sides engaging with the extensive recreational opportunities on the site \\u2013 playing tennis, swimming, sunbathing, cooking pizzas, picking olives or gathering around the fire pit or BBQ.<\\/p>\\r\\n<p>The building entry with the reflective pool, hovering rheinzinc cube and illuminated undercroft has been carefully crafted to create a hint of the fun and relaxation that being on holiday can provide. Interiors are casually grounded with the use of local stone for many walls, seamless indoor outdoor openings and rugged polished timber floors.<\\/p>\\r\\n<\\/div>","fulltext":"","state":1,"catid":"12","created":"2015-05-02 20:42:33","created_by":"989","created_by_alias":"","modified":"2015-05-02 21:06:10","modified_by":"989","checked_out":"989","checked_out_time":"2015-05-02 21:05:17","publish_up":"2015-05-02 20:42:33","publish_down":"0000-00-00 00:00:00","images":"{\\"image_intro\\":\\"\\",\\"float_intro\\":\\"\\",\\"image_intro_alt\\":\\"\\",\\"image_intro_caption\\":\\"\\",\\"image_fulltext\\":\\"\\",\\"float_fulltext\\":\\"\\",\\"image_fulltext_alt\\":\\"\\",\\"image_fulltext_caption\\":\\"\\"}","urls":"{\\"urla\\":false,\\"urlatext\\":\\"\\",\\"targeta\\":\\"\\",\\"urlb\\":false,\\"urlbtext\\":\\"\\",\\"targetb\\":\\"\\",\\"urlc\\":false,\\"urlctext\\":\\"\\",\\"targetc\\":\\"\\"}","attribs":"{\\"show_title\\":\\"\\",\\"link_titles\\":\\"\\",\\"show_tags\\":\\"\\",\\"show_intro\\":\\"\\",\\"info_block_position\\":\\"\\",\\"show_category\\":\\"\\",\\"link_category\\":\\"\\",\\"show_parent_category\\":\\"\\",\\"link_parent_category\\"