(175, 30, 1, '', '2015-05-02 21:13:02', 989, 2869, '1ddaade65180db0ddcd0e5ec656af9628e02b037', '{"id":30,"asset_id":"116","title":"Merton House","alias":"merton-house","introtext":"<div style=\\"font-size: 15px;\\">\\r\\n<p>Located in the foothills of the Great Dividing Range, this remote and steeply sloping site provides spectacular views of the Australian countryside. The building sits in a rocky outcrop and relies on the juxtaposition and linking of three simple box elements to express the building form. A large stone fireplace anchors the central core where the living room, kitchen and dining areas dramatically cantilever over the natural slope of the site. A series of decks and courtyards provide respite from prevailing winds and extremes of temperatures.<\\/p>\\r\\n<p>The house provides an enriching, uniquely rural experience where the natural beauty of the site with its shaly outcrops, wind battered trees, lush young eucalypts and climatic extremes can be celebrated and enjoyed. The use of strong shapes and the imaginative blending and contrasting of relatively low cost, conventional materials are melded together to provide an uplifting experience. The house is respectful of the landscape yet has its own force and presence in providing the occupants with great sensory and visual cinema as the days and seasons unfold around it.<\\/p>\\r\\n<\\/div>","fulltext":"","state":1,"catid":"12","created":"2015-05-02 20:42:33","created_by":"989","created_by_alias":"","modified":"2015-05-02 21:13:02","modified_by":"989","checked_out":"989","checked_out_time":"2015-05-02 21:12:04","publish_up":"2015-05-02 20:42:33","publish_down":"0000-00-00 00:00:00","images":"{\\"image_intro\\":\\"\\",\\"float_intro\\":\\"\\",\\"image_intro_alt\\":\\"\\",\\"image_intro_caption\\":\\"\\",\\"image_fulltext\\":\\"\\",\\"float_fulltext\\":\\"\\",\\"image_fulltext_alt\\":\\"\\",\\"image_fulltext_caption\\":\\"\\"}","urls":"{\\"urla\\":false,\\"urlatext\\":\\"\\",\\"targeta\\":\\"\\",\\"urlb\\