(178, 31, 1, '', '2015-05-02 21:17:47', 989, 2561, 'aba1b04cdb177b0c370719b9225101b833b806a4', '{"id":31,"asset_id":"117","title":"Richmond House","alias":"richmond-house","introtext":"<div style=\\"font-size: 15px;\\">\\r\\n<p>Responding boldly to the challenges of a tight inner city site, Richmond House provides a sanctuary amidst the traffic and intensity of the immediate surroundings. The interior is private, quiet and visually exciting. The exterior is assertive in its presence - but not dominating - and contributes to the vitality and interest of the street.<\\/p>\\r\\n<p>The front fa\\u00e7ade is notched to provide a protected entry and enable views of the Victorian cottage adjacent. Large screens prevent invasive views and rooms revolve around protective courtyards and decks. A vertical garden is the main feature of the central internal courtyard.<\\/p>\\r\\n<p>An adjacent peppercorn tree forms a protective veil. A stacked stone wall along the entry path conceals rain water tanks for the gardens and also holds grasses and orchids along the entry.<\\/p>\\r\\n<\\/div>","fulltext":"","state":0,"catid":"12","created":"2015-05-02 20:42:33","created_by":"989","created_by_alias":"","modified":"2015-05-02 21:17:47","modified_by":"989","checked_out":"989","checked_out_time":"2015-05-02 21:16:51","publish_up":"2015-05-02 20:42:33","publish_down":"","images":"{\\"image_intro\\":\\"\\",\\"float_intro\\":\\"\\",\\"image_intro_alt\\":\\"\\",\\"image_intro_caption\\":\\"\\",\\"image_fulltext\\":\\"\\",\\"float_fulltext\\":\\"\\",\\"image_fulltext_alt\\":\\"\\",\\"image_fulltext_caption\\":\\"\\"}","urls":"{\\"urla\\":false,\\"urlatext\\":\\"\\",\\"targeta\\":\\"\\",\\"urlb\\":false,\\"urlbtext\\":\\"\\",\\"targetb\\":\\"\\",\\"urlc\\":false,\\"urlctext\\":\\"\\",\\"targetc\\":\\"\\"}","attribs":"{\\"show_title\\":\\"\\",\\"link_titles\\":\\"\\",\\"show_tags\\":\\"\\",\\"show_intro\\":\\"\\",\\"info_block_position\\":\\"\\",\\"show_category\\":\\"\\",\\"link_category\\":\\"