(198, 8, 1, '', '2015-05-02 21:46:02', 989, 3698, '635ac1da3ea4b16dd59a924993efaf1845a9c60d', '{"id":8,"asset_id":"61","title":"Principals","alias":"principals","introtext":"<h4 class=\\"sapient_transparent_background\\"><span style=\\"text-decoration: underline;\\">PRINCIPLES<\\/span><\\/h4>\\r\\n<p>\\u00a0<\\/p>\\r\\n<table>\\r\\n<tbody>\\r\\n<tr>\\r\\n<td class=\\"sapient_transparent_background\\" valign=\\"top\\" width=\\"30%\\"><span style=\\"text-decoration: underline;\\">Michael Morris<\\/span><br \\/> Director\\r\\n<p>B. Arch RAIA<\\/p>\\r\\n<p>Dynamic, inventive and passionate about architecture, Michael Morris has a reputation for high quality design and a unique approach to each project. Michael\\u2019s buildings include many individual residences in city and country locations, retail showrooms, commercial offices, restaurants and cafes, tourist and leisure centres and many other specialist buildings. Michael is familiar with complex design briefs and has the experience which comes from meeting the needs of a diverse range of clients. He is closely involved in all stages of projects from concept design through to project administration.\\u00a0\\u00a0<\\/p>\\r\\n<\\/td>\\r\\n<td width=\\"5%\\">\\u00a0<\\/td>\\r\\n<td class=\\"sapient_transparent_background\\" valign=\\"top\\" width=\\"30%\\"><span style=\\"text-decoration: underline;\\"><span style=\\"text-decoration: underline;\\"><span style=\\"text-decoration: underline;\\">Christine Berry<\\/span><br \\/> Associate<\\/span><\\/span>\\r\\n<p>B.TRP<\\/p>\\r\\n<p>With a career covering many aspects of both the planning and design industries, Christine brings a depth of understanding in the delivery of projects, thus enabling a high level of successful outcomes. Working closely with the design team on each project and utilising her well-honed communication skills, Christine relates to the needs of stake holders and applies her knowledge in the liaison with government bodies and community groups in the development approval process. She is also actively involved in project concept design and project management overall.<\\/p>\\r\\n<\\/td>\\r\\n<td width=\\"30%\\">\\u00a0<\\/td>\\r\\n<\\/tr>\\r\\n<\\/tbody>\\r\\n<\\/table>\\r\\n<p>\\u00a0<\\/p>","fulltext":"","state":1,"catid":"2","created":"2015-04-03 09:46:15","created_by":"989","created_by_alias":"","modified":"2015-05-02 21:46:02","modified_by":"989","checked_out":"989","checked_out_time":"2015-05-02 21:44:58","publish_up":"2015-04-03 09:46:15","publish_down":"0000-00-00 00:00:00","images":"{\\"image_intro\\":\\"\\",\\"float_intro\\":\\"\\",\\"image_intro_alt\\":\\"\\",\\"image_intro_caption\\":\\"\\",\\"image_fulltext\\":\\"\\",\\"float_fulltext\\":\\"\\",\\"image_fulltext_alt\\":\\"\\",\\"image_fulltext_caption\\":\\"\\"}","urls":"{\\"urla\\":false,\\"urlatext\\":\\"\\",\\"targeta\\":\\"\\",\\"urlb\\":false,\\"urlbtext\\":\\"\\",\\"targetb\\":\\"\\",\\"urlc\\":false,\\"urlctext\\":\\"\\",\\"targetc\\":\\"\\"}","attribs":"{\\"show_title\\":\\"\\",\\"link_titles\\":\\"\\",\\"show_tags\\":\\"\\",\\"show_intro\\":\\"\\",\\"info_block_position\\":\\"\\",\\"show_category\\":\\"\\",\\"link_category\\":\\"\\",\\"show_parent_category\\":\\"\\",\\"link_parent_category\\":\\"\\",\\"show_author\\":\\"\\",\\"link_author\\":\\"\\",\\"show_create_date\\":\\"\\",\\"show_modify_date\\":\\"\\",\\"show_publish_date\\":\\"\\",\\"show_item_navigation\\":\\"\\",\\"show_icons\\":\\"\\",\\"show_print_icon\\":\\"\\",\\"show_email_icon\\":\\"\\",\\"show_vote\\":\\"\\",\\"show_hits\\":\\"\\",\\"show_noauth\\":\\"\\",\\"urls_position\\":\\"\\",\\"alternative_readmore\\":\\"\\",\\"article_layout\\":\\"michaelmorrisarchitectstemplate:nobackground\\",\\"show_publishing_options\\":\\"\\",\\"show_article_options\\":\\"\\",\\"show_urls_images_backend\\":\\"\\",\\"show_urls_images_frontend\\":\\"\\"}","version":18,"ordering":"2","metakey":"","metadesc":"","access":"1","hits":"57","metadata":"{\\"robots\\":\\"\\",\\"author\\":\\"\\",\\"rights\\":\\"\