(220, 43, 1, '', '2015-05-11 05:15:22', 989, 2531, 'c505201b5fd0599c170363e16c49b81b63afc323', '{"id":43,"asset_id":134,"title":"Pinecliff Horse Complex","alias":"pinecliff-horse-complex","introtext":"<p>Located on the Mornington Peninsula, Pinecliff provides state of the art facilities in horse training, and environmentally sustainable management and landscape design.<\\/p>\\r\\n<p>The original site of 50 hectares had been cleared for grazing and the site has now been transformed by the creation of a system of linked wetlands. These progressively filter waste water and enable its reuse throughout the site. A new 7.6 megalitre dam provides the final stage of this system. Water birds now flock to the site.<\\/p>\\r\\n<p>A large scale innovative worm farm - 25 metres by 10 metres by average 2 metres depth - processes all horse manure, water, cardboard and grass\\/ landscape waste within the site. The worm farm provides the initial treatment of waste with worm castings being used for ongoing fertilization of the grassed horse yards.<\\/p>","fulltext":"","state":1,"catid":"12","created":"2015-05-11 05:15:22","created_by":"989","created_by_alias":"","modified":"2015-05-11 05:15:22","modified_by":null,"checked_out":null,"checked_out_time":null,"publish_up":"2015-05-11 05:15:22","publish_down":"0000-00-00 00:00:00","images":"{\\"image_intro\\":\\"\\",\\"float_intro\\":\\"\\",\\"image_intro_alt\\":\\"\\",\\"image_intro_caption\\":\\"\\",\\"image_fulltext\\":\\"\\",\\"float_fulltext\\":\\"\\",\\"image_fulltext_alt\\":\\"\\",\\"image_fulltext_caption\\":\\"\\"}","urls":"{\\"urla\\":false,\\"urlatext\\":\\"\\",\\"targeta\\":\\"\\",\\"urlb\\":false,\\"urlbtext\\":\\"\\",\\"targetb\\":\\"\\",\\"urlc\\":false,\\"urlctext\\":\\"\\",\\"targetc\\":\\"\\"}","attribs":"{\\"show_title\\":\\"\\",\\"link_titles\\":\\"\\",\\"show_tags\\":\\"\\",\\"show_intro\\":\\"\\",\\"info_block_position\\":\\"\\",\\"show_category\\":\\"\\",\\"link_category\\":\\"\\",\\"show_parent_category\\":\\"\\",\