(225, 44, 1, '', '2015-05-11 05:35:41', 989, 2315, '0ad838229d38b18a7669444bd9b2ead83816b319', '{"id":44,"asset_id":135,"title":"Reece Design","alias":"reece-design","introtext":"<p>Located in inner city Melbourne, Reecedesign was a showroom created in 2001 for architects, interior designers and the design aware public.<\\/p>\\r\\n<p>Built over two levels in a major renovation of the existing industrial structure, the showroom provided for the display of an extensive range of bathroom and kitchen products. Water connection to many fitments enabled the full impact of tapware to be experienced \\u2013 a new innovation at the time.<\\/p>\\r\\n<p>Products featured designs from a number of international companies not seen before in Australia and a new benchmark was created in the quality of presentation for such showrooms.<\\/p>","fulltext":"","state":1,"catid":"12","created":"2015-05-11 05:35:41","created_by":"989","created_by_alias":"","modified":"2015-05-11 05:35:41","modified_by":null,"checked_out":null,"checked_out_time":null,"publish_up":"2015-05-11 05:35:41","publish_down":"0000-00-00 00:00:00","images":"{\\"image_intro\\":\\"\\",\\"float_intro\\":\\"\\",\\"image_intro_alt\\":\\"\\",\\"image_intro_caption\\":\\"\\",\\"image_fulltext\\":\\"\\",\\"float_fulltext\\":\\"\\",\\"image_fulltext_alt\\":\\"\\",\\"image_fulltext_caption\\":\\"\\"}","urls":"{\\"urla\\":false,\\"urlatext\\":\\"\\",\\"targeta\\":\\"\\",\\"urlb\\":false,\\"urlbtext\\":\\"\\",\\"targetb\\":\\"\\",\\"urlc\\":false,\\"urlctext\\":\\"\\",\\"targetc\\":\\"\\"}","attribs":"{\\"show_title\\":\\"\\",\\"link_titles\\":\\"\\",\\"show_tags\\":\\"\\",\\"show_intro\\":\\"\\",\\"info_block_position\\":\\"\\",\\"show_category\\":\\"\\",\\"link_category\\":\\"\\",\\"show_parent_category\\":\\"\\",\\"link_parent_category\\":\\"\\",\\"show_author\\":\\"\\",\\"link_author\\":\\"\\",\\"show_create_date\\":\\"\\",\\"show_modify_date\\":\\"\\",\\"show_publish_date\\":\\"\\",\\"show_item_navigation\\":\\"\\",\\"show_