(227, 45, 1, '', '2015-05-11 05:41:45', 989, 2598, 'd130bb703c6993e93fcfeb5fc4d9579378304a52', '{"id":45,"asset_id":136,"title":"Mandala Winery","alias":"mandala-winery","introtext":"<p>Preserving the magnificent views to the surrounding Yarra Ranges and providing an intense rural experience for visitors, were key determinants in the design of the Mandala Winery.<\\/p>\\r\\n<p>There is minimal definition between the indoors and outdoors. Large sections of openable glass provide for outdoor wine tasting and dining. Building materials feature corten steel, recycled rubber flooring and spotted gum timber. A Bocce court encourages outdoor recreation while the Green enables larger scale music and market events to be held and the occasional landing of hot air Balloons. All roof water is recycled for landscape uses.<\\/p>\\r\\n<p>The Melba Highway has been screened by mounds and extensive native planting and car parking is largely concealed behind a screen of vines. The Master Plan also provides for future processing of grapes on site which will further enhance the wine making experience for visitors.<\\/p>","fulltext":"","state":1,"catid":"12","created":"2015-05-11 05:41:45","created_by":"989","created_by_alias":"","modified":"2015-05-11 05:41:45","modified_by":null,"checked_out":null,"checked_out_time":null,"publish_up":"2015-05-11 05:41:45","publish_down":"0000-00-00 00:00:00","images":"{\\"image_intro\\":\\"\\",\\"float_intro\\":\\"\\",\\"image_intro_alt\\":\\"\\",\\"image_intro_caption\\":\\"\\",\\"image_fulltext\\":\\"\\",\\"float_fulltext\\":\\"\\",\\"image_fulltext_alt\\":\\"\\",\\"image_fulltext_caption\\":\\"\\"}","urls":"{\\"urla\\":false,\\"urlatext\\":\\"\\",\\"targeta\\":\\"\\",\\"urlb\\":false,\\"urlbtext\\":\\"\\",\\"targetb\\":\\"\\",\\"urlc\\":false,\\"urlctext\\":\\"\\",\\"targetc\\":\\"\\"}","attribs":"{\\"show_title\\":\\"\\",\\"link_titles\\":\\"\\",\\"show_tags\\":\\"\\",\\"show_intro\\":\\"\\",\\"info_block_position\\":\\"\\",\\"show_category\\":\\"