(263, 7, 1, '', '2015-05-12 04:36:38', 989, 2582, 'ae940ad5626db61dd6f0ddbae72fd63ea1240a6f', '{"id":7,"asset_id":"60","title":"About","alias":"about","introtext":"<p>Having set up his first practice while still at university, Michael Morris has been a director of a number of iconic practices in Melbourne including Morris and Pirrotta, Morris Architects and Morris Partnership. The formation of Michael Morris Architects continues this tradition. Always at the cutting edge of the design, Michael\\u2019s buildings are the ongoing subject of considerable acclaim. Clients include many well known personalities in the banking and business industries, government agencies, private individuals and community groups. The practice of Michael Morris Architects is purposely kept small. This enables Michael to focus on each individual building and be intimately involved from the initial design concept though to administration of the construction stage. His design team shares Michael\\u2019s commitment and passion in the achievement of high quality design outcomes.<\\/p>","fulltext":"","state":1,"catid":"2","created":"2015-04-03 09:45:45","created_by":"989","created_by_alias":"","modified":"2015-05-12 04:36:38","modified_by":"989","checked_out":"989","checked_out_time":"2015-05-12 04:36:29","publish_up":"2015-04-03 09:45:45","publish_down":"0000-00-00 00:00:00","images":"{\\"image_intro\\":\\"\\",\\"float_intro\\":\\"\\",\\"image_intro_alt\\":\\"\\",\\"image_intro_caption\\":\\"\\",\\"image_fulltext\\":\\"\\",\\"float_fulltext\\":\\"\\",\\"image_fulltext_alt\\":\\"\\",\\"image_fulltext_caption\\":\\"\\"}","urls":"{\\"urla\\":false,\\"urlatext\\":\\"\\",\\"targeta\\":\\"\\",\\"urlb\\":false,\\"urlbtext\\":\\"\\",\\"targetb\\":\\"\\",\\"urlc\\":false,\\"urlctext\\":\\"\\",\\"targetc\\":\\"\\"}","attribs":"{\\"show_title\\":\\"\\",\\"link_titles\\":\\"\\",\\"show_tags\\":\\"\\",\\"show_intro\\":\\"\\",\\"info_block_position\\":\\"\\",\\"show_category\\":\\"\\",\\"link_category\\":\\"\\