(279, 31, 1, '', '2015-07-03 04:54:37', 989, 2533, 'cc558ffc7d21d1d06e4711f96ec3634210200642', '{"id":31,"asset_id":"117","title":"Richmond House","alias":"richmond-house","introtext":"<p>Responding boldly to the challenges of a tight inner city site, Richmond House provides a sanctuary amidst the traffic and intensity of the immediate surroundings. The interior is private, quiet and visually exciting. The exterior is assertive in its presence - but not dominating - and contributes to the vitality and interest of the street.<\\/p>\\r\\n<p>The front fa\\u00e7ade is notched to provide a protected entry and enable views of the Victorian cottage adjacent. Large screens prevent invasive views and rooms revolve around protective courtyards and decks. A vertical garden is the main feature of the central internal courtyard.<\\/p>\\r\\n<p>An adjacent peppercorn tree forms a protective veil. A stacked stone wall along the entry path conceals rain water tanks for the gardens and also holds grasses and orchids along the entry.<\\/p>","fulltext":"","state":1,"catid":"12","created":"2015-05-02 20:42:33","created_by":"989","created_by_alias":"","modified":"2015-07-03 04:54:37","modified_by":"989","checked_out":"989","checked_out_time":"2015-07-03 04:54:07","publish_up":"2015-05-02 20:42:33","publish_down":"0000-00-00 00:00:00","images":"{\\"image_intro\\":\\"\\",\\"float_intro\\":\\"\\",\\"image_intro_alt\\":\\"\\",\\"image_intro_caption\\":\\"\\",\\"image_fulltext\\":\\"\\",\\"float_fulltext\\":\\"\\",\\"image_fulltext_alt\\":\\"\\",\\"image_fulltext_caption\\":\\"\\"}","urls":"{\\"urla\\":false,\\"urlatext\\":\\"\\",\\"targeta\\":\\"\\",\\"urlb\\":false,\\"urlbtext\\":\\"\\",\\"targetb\\":\\"\\",\\"urlc\\":false,\\"urlctext\\":\\"\\",\\"targetc\\":\\"\\"}","attribs":"{\\"show_title\\":\\"\\",\\"link_titles\\":\\"\\",\\"show_tags\\":\\"\\",\\"show_intro\\":\\"\\",\\"info_block_position\\":\\"\\",\\"show_category\\":\\"\\",\\"link_category\\":\\"\\",\\"show_parent_category\\":\\"\