(281, 9, 5, '', '2015-08-24 19:53:37', 989, 587, 'ae1f8b98402f6e39d7fed35690a6018d5084727d', '{"id":9,"asset_id":"81","parent_id":"1","lft":"17","rgt":"18","level":"1","path":"comerical","extension":"com_content","title":"Commercial","alias":"comerical","note":"","description":"","published":"1","checked_out":"989","checked_out_time":"2015-08-24 19:53:20","access":"1","params":"{\\"category_layout\\":\\"\\",\\"image\\":\\"\\",\\"image_alt\\":\\"\\"}","metadesc":"","metakey":"","metadata":"{\\"author\\":\\"\\",\\"robots\\":\\"\\"}","created_user_id":"989","created_time":"2015-04-16 05:32:08","modified_user_id":"989","modified_time":"2015-08-24 19:53:37","hits":"0","language":"*","version":"1"}', 0),
(282, 8, 1, '', '2015-08-24 20:09:59', 989, 3589, 'a981e966692d41145745a1302ed5c73fe93d8b57', '{"id":8,"asset_id":"61","title":"Principals","alias":"principals","introtext":"<p>\\u00a0<\\/p>\\r\\n<table>\\r\\n<tbody>\\r\\n<tr>\\r\\n<td class=\\"sapient_transparent_background\\" valign=\\"top\\" width=\\"30%\\"><span style=\\"text-decoration: underline;\\">Michael Morris<\\/span><br \\/> Director\\r\\n<p>B. Arch RAIA<\\/p>\\r\\n<p>Dynamic, inventive and passionate about architecture, Michael Morris has a reputation for high quality design and a unique approach to each project. Michael\\u2019s buildings include many individual residences in city and country locations, retail showrooms, commercial offices, restaurants and cafes, tourist and leisure centres and many other specialist buildings. Michael is familiar with complex design briefs and has the experience which comes from meeting the needs of a diverse range of clients. He is closely involved in all stages of projects from concept design through to project administration.\\u00a0\\u00a0<\\/p>\\r\\n<\\/td>\\r\\n<td width=\\"5%\\">\\u00a0<\\/td>\\r\\n<td class=\\"sapient_transparent_background\\" valign=\\"top\\" width=\\"30%\\"><span style=\\"text-decoration: underline;\\">Christine Berry<\\/span><br \\/> Associate\\r\\n<p>B.TRP<\\/p>\\r\\n<p>With substantial experience in the planning, marketing and design industries, Christine brings a depth of understanding in the delivery of projects. She is actively involved with the design team in project concept design, town planning approvals and project administration. Christine\\u2019s input contributes to the practice\\u2019s high level of successful outcomes in the development approval process. In addition her familiarity with the design brief, the design development stage and the final construction stage combined with her well honed communication skills provides a comprehensive background to assist in achieving client\\u2019s expectations and the desired project outcomes overall.<\\/p>\\r\\n<\\/td>\\r\\n<td width=\\"30%\\">\\u00a0<\\/td>\\r\\n<\\/tr>\\r\\n<\\/tbody>\\r\\n<\\/table>","fulltext":"","state":1,"catid":"2","created":"2015-04-03 09:46:15","created_by":"989","created_by_alias":"","modified":"2015-08-24 20:09:59","modified_by":"989","checked_out":"989","checked_out_time":"2015-08-24 20:09:49","publish_up":"2015-04-03 09:46:15","publish_down":"0000-00-00 00:00:00","images":"{\\"image_intro\\":\\"\\",\\"float_intro\\":\\"\\",\\"image_intro_alt\\":\\"\\",\\"image_intro_caption\\":\\"\\",\\"image_fulltext\\":\\"\\",\\"float_fulltext\\":\\"\\",\\"image_fulltext_alt\\":\\"\\",\\"image_fulltext_caption\\":\\"\\"}","urls":"{\\"urla\\":false,\\"urlatext\\":\\"\\",\\"targeta\\":\\"\\",\\"urlb\\":false,\\"urlbtext\\":\\"\\",\\"targetb\\":\\"\\",\\"urlc\\":false,\\"urlctext\\":\\"\\",\\"targetc\\":\\"\\"}","attribs":"{\\"show_title\\":\\"\\",\\"link_titles\\":\\"\\",\\"show_tags\\":\\"\\",\\"show_intro\\":\\"\\",\\"info_block_position\\":\\"\\",\\"show_category\\":\\"\\",\\"link_category\\":\\"\\",\\"show_parent_category\\":\\"\\",\\"link_parent_category\\":\\"\\",\\"show_author\\":\\"\\",\\"link_author\\":\\"\\",\\"show_create_date\\":\\"\\",\\"show_modify_date\\":\\"\\",\\"show_publish_date\\":\\"\\",\\"show_item_navigation\\":\\"\\",\\"show_icons\\":\\"\\",\\"show_print_icon\\":\\"\\",\\"show_email_icon\\":\\"\\",\\"show_vote\\":\\"\\",\\"show_hits\\":\\"\\",\\"show_noauth\\":\\"\\",\\"urls_position\\":\\"\\",\\"alternative_readmore\\":\\"\\",\\"article_layout\\":\\"michaelmorrisarchitectstemplate:nobackground\\",\\"show_publishing_options\\":\\"\\",\\"show_article_options\\":\\"\\",\\"show_urls_images_backend\\":\\"\\",\\"show_urls_images_frontend\\":\\"\\"}","version":23,"ordering":"2","metakey":"","metadesc":"","access":"1","hits":"77","metadata":"{\\"robots\\":\\"\\",\\"author\\":\\"\\",\\"rights\\":\\"\\",\\"xreference\\":\\"\\"}","featured":"0","language":"*","xreference":""}', 0),
(283, 7, 1, '', '2015-08-24 20:13:03', 989, 2697, 'a92fdfbc5915eb7bd42617423c450ce9bd39acc9', '{"id":7,"asset_id":"60","title":"About","alias":"about","introtext":"<h1>The Design Practice<\\/h1>\\r\\n<p>Having set up his first practice while still at university, Michael Morris has been a director of a number of iconic practices in Melbourne including Morris and Pirrotta, Morris Architects and Morris Partnership.<\\/p>\\r\\n<p>The formation of Michael Morris Architects continues this tradition.<\\/p>\\r\\n<p>Always at the cutting edge of the design, Michael\\u2019s buildings are the ongoing subject of considerable acclaim. Clients include many well known personalities in the banking and business industries, government agencies, private individuals and community groups.<\\/p>\\r\\n<p>The practice of Michael Morris Architects is purposely kept small. This enables Michael to focus on each individual building and be intimately involved from the initial design concept though to administration of the construction stage.<\\/p>\\r\\n<p>His design team shares Michael\\u2019s commitment and passion in the achievement of high quality design outcomes.<\\/p>\\r\\n<p>\\u00a0<\\/p>\\r\\n<p>\\u00a0<\\/p>","fulltext":"","state":1,"catid":"2","created":"2015-04-03 09:45:45","created_by":"989","created_by_alias":"","modified":"2015-08-24 20:13:03","modified_by":"989","checked_out":"989","checked_out_time":"2015-08-24 20:12:54","publish_up":"2015-04-03 09:45:45","publish_down":"0000-00-00 00:00:00","images":"{\\"image_intro\\":\\"\\",\\"float_intro\\":\\"\\",\\"image_intro_alt\\":\\"\\",\\"image_intro_caption\\":\\"\\",\\"image_fulltext\\":\\"\\",\\"float_fulltext\\":\\"\\",\\"image_fulltext_alt\\":\\"\\",\\"image_fulltext_caption\\":\\"\\"}","urls":"{\\"urla\\":false,\\"urlatext\\":\\"\\",\\"targeta\\":\\"\\",\\"urlb\\":false,\\"urlbtext\\":\\"\\",\\"targetb\\":\\"\\",\\"urlc\\":false,\\"urlctext\\":\\"\\",\\"targetc\\":\\"\\"}","attribs":"{\\"show_title\\":\\"\\",\\"link_titles\\":\\"