(286, 42, 1, '', '2015-08-25 04:10:24', 989, 2218, '6440b9abb4c0611a2997e3d5d05fb199dc1b75c0', '{"id":42,"asset_id":"133","title":"Frueauf Village","alias":"frueauf-village","introtext":"<div>\\r\\n<p>This multi-purpose ski village is located in the High Plains of South East Victoria at Falls Creek. The central core provides for a cinema and restaurant and is surrounded by separate lodges. The extreme climate has required the careful selection of materials which are natural stone, copper and timber cladding and galvanized steelwork. The vibrant combination of materials, together with the fragmented massing of the lodges, has created an exciting, iconic and popular destination in the resort.<\\/p>\\r\\n<\\/div>","fulltext":"","state":1,"catid":"12","created":"2015-05-11 05:08:45","created_by":"989","created_by_alias":"","modified":"2015-08-25 04:10:24","modified_by":"989","checked_out":"989","checked_out_time":"2015-08-25 04:10:00","publish_up":"2015-05-11 05:08:45","publish_down":"0000-00-00 00:00:00","images":"{\\"image_intro\\":\\"\\",\\"float_intro\\":\\"\\",\\"image_intro_alt\\":\\"\\",\\"image_intro_caption\\":\\"\\",\\"image_fulltext\\":\\"\\",\\"float_fulltext\\":\\"\\",\\"image_fulltext_alt\\":\\"\\",\\"image_fulltext_caption\\":\\"\\"}","urls":"{\\"urla\\":false,\\"urlatext\\":\\"\\",\\"targeta\\":\\"\\",\\"urlb\\":false,\\"urlbtext\\":\\"\\",\\"targetb\\":\\"\\",\\"urlc\\":false,\\"urlctext\\":\\"\\",\\"targetc\\":\\"\\"}","attribs":"{\\"show_title\\":\\"\\",\\"link_titles\\":\\"\\",\\"show_tags\\":\\"\\",\\"show_intro\\":\\"\\",\\"info_block_position\\":\\"\\",\\"show_category\\":\\"\\",\\"link_category\\":\\"\\",\\"show_parent_category\\":\\"\\",\\"link_parent_category\\":\\"\\",\\"show_author\\":\\"\\",\\"link_author\\":\\"\\",\\"show_create_date\\":\\"\\",\\"show_modify_date\\":\\"\\",\\"show_publish_date\\":\\"\\",\\"show_item_navigation\\":\\"\\",\\"show_icons\\":\\"\\",\\"show_print_icon\\":\\"\\",\\"show_email_icon\\":\\"\\",\\"show_vote\\":\\"\\",