(288, 45, 1, '', '2015-08-25 04:11:33', 989, 2664, 'b3471cc83ecbc1ac71147ee9a806aa1f20dcbca9', '{"id":45,"asset_id":"136","title":"Mandala Winery","alias":"mandala-winery","introtext":"<div style=\\"font-size: 15px;\\">\\r\\n<p>Preserving the magnificent views to the surrounding Yarra Ranges and providing an intense rural experience for visitors, were key determinants in the design of the Mandala Winery.<\\/p>\\r\\n<p>There is minimal definition between the indoors and outdoors. Large sections of openable glass provide for outdoor wine tasting and dining. Building materials feature corten steel, recycled rubber flooring and spotted gum timber. A Bocce court encourages outdoor recreation while the Green enables larger scale music and market events to be held and the occasional landing of hot air Balloons. All roof water is recycled for landscape uses.<\\/p>\\r\\n<p>The Melba Highway has been screened by mounds and extensive native planting and car parking is largely concealed behind a screen of vines. The Master Plan also provides for future processing of grapes on site which will further enhance the wine making experience for visitors.<\\/p>\\r\\n<\\/div>","fulltext":"","state":1,"catid":"12","created":"2015-05-11 05:41:45","created_by":"989","created_by_alias":"","modified":"2015-08-25 04:11:33","modified_by":"989","checked_out":"989","checked_out_time":"2015-08-25 04:11:19","publish_up":"2015-05-11 05:41:45","publish_down":"0000-00-00 00:00:00","images":"{\\"image_intro\\":\\"\\",\\"float_intro\\":\\"\\",\\"image_intro_alt\\":\\"\\",\\"image_intro_caption\\":\\"\\",\\"image_fulltext\\":\\"\\",\\"float_fulltext\\":\\"\\",\\"image_fulltext_alt\\":\\"\\",\\"image_fulltext_caption\\":\\"\\"}","urls":"{\\"urla\\":false,\\"urlatext\\":\\"\\",\\"targeta\\":\\"\\",\\"urlb\\":false,\\"urlbtext\\":\\"\\",\\"targetb\\":\\"\\",\\"urlc\\":false,\\"urlctext\\":\\"\\",\\"targetc\\":\\"\\"}","attribs":"{\\"show_title\\":\\"\\",\\"link_titles\\":\\"\\",\\"show_tags\\":\\"\\",\\"show_intro\\":\\"\\",\\"info_block_position\\":\\"\\",\\"show_category\\":\\"\\",\\"link_category\\":\\"\\",\\"show_parent_category\\":\\"\\",\\"link_parent_category\\":\\"\\",\\"show_author\\":\\"\\",\\"link_author\\":\\"\\",\\"show_create_date\\":\\"\\",\\"show_modify_date\\":\\"\\",\\"show_publish_date\\":\\"\\",\\"show_item_navigation\\":\\"\\",\\"show_icons\\":\\"\\",\\"show_print_icon\\":\\"\\",\\"show_email_icon\\":\\"\\",\\"show_vote\\":\\"\\",\\"show_hits\\":\\"\\",\\"show_noauth\\":\\"\\",\\"urls_position\\":\\"\\",\\"alternative_readmore\\":\\"\\",\\"article_layout\\":\\"\\",\\"show_publishing_options\\":\\"\\",\\"show_article_options\\":\\"\\",\\"show_urls_images_backend\\":\\"\\",\\"show_urls_images_frontend\\":\\"\\"}","version":2,"ordering":"0","metakey":"","metadesc":"","access":"1","hits":"0","metadata":"{\\"robots\\":\\"\\",\\"author\\":\\"\\",\\"rights\\":\\"\\",\\"xreference\\":\\"\\"}","featured":"0","language":"*","xreference":""}', 0),
(289, 43, 1, '', '2015-08-25 04:12:00', 989, 2597, '5fac4a76c0a076640a6b2eba918d2ba41c460319', '{"id":43,"asset_id":"134","title":"Pinecliff Horse Complex","alias":"pinecliff-horse-complex","introtext":"<div style=\\"font-size: 15px;\\">\\r\\n<p>Located on the Mornington Peninsula, Pinecliff provides state of the art facilities in horse training, and environmentally sustainable management and landscape design.<\\/p>\\r\\n<p>The original site of 50 hectares had been cleared for grazing and the site has now been transformed by the creation of a system of linked wetlands. These progressively filter waste water and enable its reuse throughout the site. A new 7.6 megalitre dam provides the final stage of this system. Water birds now flock to the site.<\\/p>\\r\\n<p>A large scale innovative worm farm - 25 metres by 10 metres by average 2 metres depth - processes all horse manure, water, cardboard and grass\\/ landscape waste within the site. The worm farm provides the initial treatment of waste with worm castings being used for ongoing fertilization of the grassed horse yards.<\\/p>\\r\\n<\\/div>","fulltext":"","state":1,"catid":"12","created":"2015-05-11 05:15:22","created_by":"989","created_by_alias":"","modified":"2015-08-25 04:12:00","modified_by":"989","checked_out":"989","checked_out_time":"2015-08-25 04:11:47","publish_up":"2015-05-11 05:15:22","publish_down":"0000-00-00 00:00:00","images":"{\\"image_intro\\":\\"\\",\\"float_intro\\":\\"\\",\\"image_intro_alt\\":\\"\\",\\"image_intro_caption\\":\\"\\",\\"image_fulltext\\":\\"\\",\\"float_fulltext\\":\\"\\",\\"image_fulltext_alt\\":\\"\\",\\"image_fulltext_caption\\":\\"\\"}","urls":"{\\"urla\\":false,\\"urlatext\\":\\"\\",\\"targeta\\":\\"\\",\\"urlb\\":false,\\"urlbtext\\":\\"\\",\\"targetb\\":\\"\\",\\"urlc\\":false,\\"urlctext\\":\\"\\",\\"targetc\\":\\"\\"}","attribs":"{\\"show_title\\":\\"\\",\\"link_titles\\":\\"\\",\\"show_tags\\":\\"\\",\\"show_intro\\":\\"\\",\\"info_block_position\\":\\"\\",\\"show_category\\":\\"\\",\\"link_category\\":\\"\\",\\"show_parent_category\\":\\"\\",\\"link_parent_category\\":\\"\\",\\"show_author\\":\\"\\",\\"link_author\\":\\"\\",\\"show_create_date\\":\\"\\",\\"show_modify_date\\":\\"\\",\\"show_publish_date\\":\\"\\",\\"show_item_navigation\\":\\"\\",\\"show_icons\\":\\"\\",\\"show_print_icon\\":\\"\\",\\"show_email_icon\\":\\"\\",\\"show_vote\\":\\"\\",\\"show_hits\\":\\"\\",\\"show_noauth\\":\\"\\",\\"urls_position\\":\\"\\",\\"alternative_readmore\\":\\"\\",\\"article_layout\\":\\"\\",\\"show_publishing_options\\":\\"\\",\\"show_article_options\\":\\"\\",\\"show_urls_images_backend\\":\\"\\",\\"show_urls_images_frontend\\":\\"\\"}","version":2,"ordering":"2","metakey":"","metadesc":"","access":"1","hits":"0","metadata":"{\\"robots\\":\\"\\",\\"author\\":\\"\\",\\"rights\\":\\"\\",\\"xreference\\":\\"\\"}","featured":"0","language":"*","xreference":""}', 0),
(290, 44, 1, '', '2015-08-25 04:12:22', 989, 2381, '1b2246d08926495a466b072e0b89459f92b60aed', '{"id":44,"asset_id":"135","title":"Reece Design","alias":"reece-design","introtext":"<div style=\\"font-size: 15px;\\">\\r\\n<p>Located in inner city Melbourne, Reecedesign was a showroom created in 2001 for architects, interior designers and the design aware public.<\\/p>\\r\\n<p>Built over two levels in a major renovation of the existing industrial structure, the showroom provided for the display of an extensive range of bathroom and kitchen products. Water connection to many fitments enabled the full impact of tapware to be experienced \\u2013 a new innovation at the time.<\\/p>\\r\\n<p>Products featured designs from a number of international companies not seen before in Australia and a new benchmark was created in the quality of presentation for such showrooms.<\\/p>\\r\\n<\\/div>","fulltext":"","state":1,"catid":"12","created":"2015-05-11 05:35:41","created_by":"989","created_by_alias":"","modified":"2015-08-25 04:12:22","modified_by":"989","checked_out":"989","checked_out_time":"2015-08-25 04:12:10","publish_up":"2015-05-11 05:35:41","publish_down":"0000-00-00 00:00:00","images":"{\\"image_intro\\":\\"\\",\\"float_intro\\":\\"\\",\\"image_intro_alt\\":\\"\\",\\"image_intro_caption\\":\\"\\",\\"image_fulltext\\":\\"\\",\\"float_fulltext\\":\\"\\",\\"image_fulltext_alt\\":\\"\\",\\"image_fulltext_caption\\":\\"\\"}","urls":"{\\"urla\\":false,\\"urlatext\\":\\"\\",\\"targeta\\":\\"\\",\\"urlb\\":false,\\"urlbtext\\":\\"\\",\\"targetb\\":\\"\\",\\"urlc\\":false,\\"urlctext\\":\\"\\",\\"targetc\\":\\"\\"}","attribs":"{\\"show_title\\":\\"\\",\\"link_titles\\":\\"\\",\\"show_tags\\":\\"\\",\\"show_intro\\":\\"\\",\\"info_block_position\\":\\"\\",\\"show_category\\":\\"\\",\\"link_category\\":\\"\\",\\"show_parent_category\\":\\"\\",\\"link_parent_category\\":\\"\\",\\"show_author\\":\\"\\",\\"link_author\\":\\"\\",\\"show_create_date\\":\\"\\",\\"show_modify_date\\":\\"\\