(291, 39, 1, '', '2015-08-25 04:14:54', 989, 2114, '06c383a8513db23343fbc0df08f780fe725fab94', '{"id":39,"asset_id":"129","title":"Monsoon","alias":"monsoon","introtext":"<div style=\\"font-size: 15px;\\">\\r\\n<p>A range of tapware for Sussex Taps was designed in early 2003. Manufactured in Australia to a high standard including marine grade stainless steel, the range is ongoing with the Monsoon Shower and Mixer being a perennial favorite.<\\/p>\\r\\n<p>As part of the overall design process marketing material was created to promote the monsoon products in the leisure and resort market. \\u00a0<\\/p>\\r\\n<\\/div>","fulltext":"","state":1,"catid":"12","created":"2015-05-06 21:58:31","created_by":"989","created_by_alias":"","modified":"2015-08-25 04:14:54","modified_by":"989","checked_out":"989","checked_out_time":"2015-08-25 04:14:42","publish_up":"2015-05-06 21:58:31","publish_down":"0000-00-00 00:00:00","images":"{\\"image_intro\\":\\"\\",\\"float_intro\\":\\"\\",\\"image_intro_alt\\":\\"\\",\\"image_intro_caption\\":\\"\\",\\"image_fulltext\\":\\"\\",\\"float_fulltext\\":\\"\\",\\"image_fulltext_alt\\":\\"\\",\\"image_fulltext_caption\\":\\"\\"}","urls":"{\\"urla\\":false,\\"urlatext\\":\\"\\",\\"targeta\\":\\"\\",\\"urlb\\":false,\\"urlbtext\\":\\"\\",\\"targetb\\":\\"\\",\\"urlc\\":false,\\"urlctext\\":\\"\\",\\"targetc\\":\\"\\"}","attribs":"{\\"show_title\\":\\"\\",\\"link_titles\\":\\"\\",\\"show_tags\\":\\"\\",\\"show_intro\\":\\"\\",\\"info_block_position\\":\\"\\",\\"show_category\\":\\"\\",\\"link_category\\":\\"\\",\\"show_parent_category\\":\\"\\",\\"link_parent_category\\":\\"\\",\\"show_author\\":\\"\\",\\"link_author\\":\\"\\",\\"show_create_date\\":\\"\\",\\"show_modify_date\\":\\"\\",\\"show_publish_date\\":\\"\\",\\"show_item_navigation\\":\\"\\",\\"show_icons\\":\\"\\",\\"show_print_icon\\":\\"\\",\\"show_email_icon\\":\\"\\",\\"show_vote\\":\\"\\",\\"show_hits\\":\\"\\",\\"show_noauth\\":\\"\\",\\"urls_position\\":\\"\\",\\"alternative_readmore