(329, 7, 1, '', '2016-06-09 01:50:31', 989, 2732, '07f68a28f3e605000c9292233929fe86ab783f11', '{"id":7,"asset_id":"60","title":"About","alias":"about","introtext":"<h2 class=\\"sap_h2_heading\\">THE DESIGN PRACTICE<\\/h2>\\r\\n<p>Having set up his first practice while still at university, Michael Morris has been a director of a number of iconic practices in Melbourne including Morris and Pirrotta, Morris Architects and Morris Partnership.<\\/p>\\r\\n<p>The formation of Michael Morris Architects continues this tradition.<\\/p>\\r\\n<p>Always at the cutting edge of the design, Michael\\u2019s buildings are the ongoing subject of considerable acclaim. Clients include many well known personalities in the banking and business industries, government agencies, private individuals and community groups.<\\/p>\\r\\n<p>The practice of Michael Morris Architects is purposely kept small. This enables Michael to focus on each individual building and be intimately involved from the initial design concept though to administration of the construction stage.<\\/p>\\r\\n<p>His dedicated design team shares Michael\\u2019s commitment and passion in the achievement of high quality design outcomes.<\\/p>\\r\\n<p>\\u00a0<\\/p>\\r\\n<p>\\u00a0<\\/p>","fulltext":"","state":1,"catid":"2","created":"2015-04-03 09:45:45","created_by":"989","created_by_alias":"","modified":"2016-06-09 01:50:31","modified_by":"989","checked_out":"989","checked_out_time":"2016-06-09 01:50:08","publish_up":"2015-04-03 09:45:45","publish_down":"0000-00-00 00:00:00","images":"{\\"image_intro\\":\\"\\",\\"float_intro\\":\\"\\",\\"image_intro_alt\\":\\"\\",\\"image_intro_caption\\":\\"\\",\\"image_fulltext\\":\\"\\",\\"float_fulltext\\":\\"\\",\\"image_fulltext_alt\\":\\"\\",\\"image_fulltext_caption\\":\\"\\"}","urls":"{\\"urla\\":false,\\"urlatext\\":\\"\\",\\"targeta\\":\\"\\",\\"urlb\\":false,\\"urlbtext\\":\\"\\",\\"targetb\\":\\"\\",\\"urlc\\":false,\\"urlctext\\":\\"\\",\\"targetc\\":\\"\\"}","attribs":"{\\"show_title\\":\\"\\",\\"link_titles\\":\\"\\",\\"show_tags\\":\\"\\",\\"show_intro\\":\\"\\",\\"info_block_position\\":\\"\\",\\"show_category\\":\\"\\",\\"link_category\\":\\"\\",\\"show_parent_category\\":\\"\\",\\"link_parent_category\\":\\"\\",\\"show_author\\":\\"\\",\\"link_author\\":\\"\\",\\"show_create_date\\":\\"\\",\\"show_modify_date\\":\\"\\",\\"show_publish_date\\":\\"\\",\\"show_item_navigation\\":\\"\\",\\"show_icons\\":\\"\\",\\"show_print_icon\\":\\"\\",\\"show_email_icon\\":\\"\\",\\"show_vote\\":\\"\\",\\"show_hits\\":\\"\\",\\"show_noauth\\":\\"\\",\\"urls_position\\":\\"\\",\\"alternative_readmore\\":\\"\\",\\"article_layout\\":\\"_:default\\",\\"show_publishing_options\\":\\"\\",\\"show_article_options\\":\\"\\",\\"show_urls_images_backend\\":\\"\\",\\"show_urls_images_frontend\\":\\"\\"}","version":17,"ordering":"3","metakey":"","metadesc":"","access":"1","hits":"133","metadata":"{\\"robots\\":\\"\\",\\"author\\":\\"\\",\\"rights\\":\\"\\",\\"xreference\\":\\"\\"}","featured":"0","language":"*","xreference":""}', 0),
(330, 58, 1, '', '2016-06-09 02:08:56', 989, 3732, 'f4393ee2eab5605534fc54597bea3a0962bb6dd1', '{"id":58,"asset_id":"163","title":"Principals Mobile","alias":"principals-2","introtext":"<h2 class=\\"sapient_transparent_background\\"><span style=\\"text-decoration: underline;\\">DESIGN PRINCIPALS<\\/span><\\/h2>\\r\\n<table>\\r\\n<tbody>\\r\\n<tr>\\r\\n<td class=\\"sapient_transparent_background\\" valign=\\"top\\" width=\\"30%\\"><span style=\\"text-decoration: underline;\\">Michael Morris<\\/span><br \\/> Director\\r\\n<p>B. Arch RAIA<\\/p>\\r\\n<p>Dynamic, inventive and passionate about architecture, Michael Morris has a reputation for high quality design and a unique approach to each project. Michael\\u2019s buildings include many individual residences in city and country locations, retail showrooms, commercial offices, restaurants and cafes, tourist and leisure centres and many other specialist buildings. Michael is familiar with complex design briefs and has the experience which comes from meeting the needs of a diverse range of clients. He is closely involved in all stages of projects from concept design through to project administration.\\u00a0\\u00a0<\\/p>\\r\\n<\\/td>\\r\\n<\\/tr>\\r\\n<tr>\\r\\n<td class=\\"sapient_transparent_background\\" valign=\\"top\\" width=\\"30%\\"><span style=\\"text-decoration: underline;\\">\\u00a0<\\/span><span style=\\"text-decoration: underline;\\">Christine Berry<\\/span><br \\/> Associate\\r\\n<p>B.TRP<\\/p>\\r\\n<p>With substantial experience in the planning, marketing and design industries, Christine brings a depth of understanding in the delivery of projects. She is actively involved with the design team in project concept design, town planning approvals and project administration. Christine\\u2019s input contributes to the practice\\u2019s high level of successful outcomes in the development approval process. In addition her familiarity with the design brief, the design development stage and the final construction stage