(347, 62, 1, '', '2016-06-09 06:14:30', 989, 3017, '9d47adb5ef72da45a373ff7c1a52e03ae0e5ecf9', '{"id":62,"asset_id":"170","title":"Hidden Warehouse","alias":"hidden-warehouse-2","introtext":"<p><span style=\\"line-height: 115%; font-family: ''Calibri'',sans-serif; font-size: 10pt; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: ''Times New Roman''; mso-bidi-theme-font: minor-bidi; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\\"><span style=\\"color: #000000;\\">\\uf0d8 The retention of the original concrete slab and the steel beam roof structure of this 1960\\u2019s factory provides a spacious and enlivening framework for its residential use. Pock marked rendered walls have been simply painted and interior lighting has been cabled through the exposed metal tubing suspended below the ceiling line. The minimum of internal structure provides a continual reminder of the building\\u2019s origins and adds to the excitement of the internal space. An enclosed courtyard has been re landscaped and provides a private open space large enough for vegetables in containers and flourishing citrus trees. A narrow side finger of land - seen at the entry - has been transformed by lush landscaping. <\\/span><\\/span><\\/p>\\r\\n","fulltext":"\\r\\n<p>\\u00a0{loadposition residential_hidden_warehouse}<\\/p>","state":1,"catid":"8","created":"2015-04-09 02:43:58","created_by":"989","created_by_alias":"","modified":"2016-06-09 06:14:30","modified_by":"989","checked_out":"989","checked_out_time":"2016-06-09 06:13:03","publish_up":"2015-04-09 02:43:58","publish_down":"0000-00-00 00:00:00","images":"{\\"image_intro\\":\\"images\\\\\\/Projects\\\\\\/residential\\\\\\/richmond_house\\\\\\/richmond_house_article_listing.jpg\\",\\"float_intro\\":\\"\\",\\"image_intro_alt\\":\\"\\",\\"image_intro_caption\\":\\"\\",\\"image_fulltext\\":\\"\\",\\"floa