(356, 63, 1, '', '2016-06-09 06:20:05', 989, 2637, 'a7b21d3797a07b86703ce587d3b8dd67e2259db6', '{"id":63,"asset_id":"171","title":"Hidden Warehouse","alias":"hidden-warehouse-2","introtext":"<div style=\\"font-size: 15px;\\">\\u00a0<\\/div>\\r\\n<div style=\\"font-size: 15px;\\">The retention of the original concrete slab and the steel beam roof structure of this 1960\\u2019s factory provides a spacious and enlivening framework for its residential use.Pock marked rendered walls have been simply painted and interior lighting has been cabled through the exposed metal tubing suspended below the ceiling line.<\\/div>\\r\\n<div style=\\"font-size: 15px;\\">\\u00a0<\\/div>\\r\\n<div style=\\"font-size: 15px;\\">The minimum of internal structure provides a continual reminder of the building\\u2019s origins and adds to the excitement of the internal space. An enclosed courtyard has been re landscaped and provides a private open space large enough for vegetables in containers and flourishing citrus trees.<\\/div>\\r\\n<div style=\\"font-size: 15px;\\">A narrow side finger of land - seen at the entry - has been transformed by lush landscaping.<\\/div>","fulltext":"","state":1,"catid":"12","created":"2015-05-11 05:41:45","created_by":"989","created_by_alias":"","modified":"2016-06-09 06:20:05","modified_by":"989","checked_out":"989","checked_out_time":"2016-06-09 06:19:56","publish_up":"2015-05-11 05:41:45","publish_down":"0000-00-00 00:00:00","images":"{\\"image_intro\\":\\"\\",\\"float_intro\\":\\"\\",\\"image_intro_alt\\":\\"\\",\\"image_intro_caption\\":\\"\\",\\"image_fulltext\\":\\"\\",\\"float_fulltext\\":\\"\\",\\"image_fulltext_alt\\":\\"\\",\\"image_fulltext_caption\\":\\"\\"}","urls":"{\\"urla\\":false,\\"urlatext\\":\\"\\",\\"targeta\\":\\"\\",\\"urlb\\":false,\\"urlbtext\\":\\"\\",\\"targetb\\":\\"\\",\\"urlc\\":false,\\"urlctext\\":\\"\\",\\"targetc\\":\\"\\"}","attribs":"{\\"show_title\\":\\"\\",\\"link_titles\\":\\"\\",\\"show_tags\\":\\"\\",\\"show_intro\\":\\